contracts/Lock.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

// Uncomment this line to use console.log
// import "hardhat/console.sol";

contract Lock {
    uint public unlockTime;
    address payable public owner;

    event Withdrawal(uint amount, uint when);

    constructor(uint _unlockTime) payable {
        require(
            block.timestamp < _unlockTime,
            "Unlock time should be in the future"
        );

        unlockTime = _unlockTime;
        owner = payable(msg.sender);
    }

    function withdraw() public {
        // Uncomment this line, and the import of "hardhat/console.sol", to print a log in your terminal
        // console.log("Unlock time is %o and block timestamp is %o", unlockTime, block.timestamp);

        require(block.timestamp >= unlockTime, "You can't withdraw yet");
        require(msg.sender == owner, "You aren't the owner");

        emit Withdrawal(address(this).balance, block.timestamp);

        owner.transfer(address(this).balance);
    }
}

contracts/TaskBounty.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

/**
 * @title TaskBounty
 * @dev A contract for managing bounty tasks with multiple validators
 * @notice Allows creation of tasks, submission of proposals, and validation by approved validators
 */
contract TaskBounty {
    // ============ Structs ============
    struct Proposal {
        address hunter;
        string proofOfWork;
        uint256 timestamp;
        uint256 approvalCount;
        bool isApproved;
    }

    struct Task {
        string description;
        uint256 reward;
        uint256 deadline;
        uint256 createdAt;
        bool isCompleted;
        uint256 minApprovals;
    }

    // ============ State Variables ============
    address public immutable owner;
    Task public currentTask;
    mapping(address => bool) public validators;
    mapping(uint256 => mapping(address => bool)) public proposalApprovers;
    Proposal[] public proposals;
    uint256 public validatorCount;
    
    // ============ Events ============
    event ProposalSubmitted(address indexed hunter, uint256 indexed proposalId);
    event ProposalApproved(uint256 indexed proposalId);
    event DisputeRaised(address indexed disputeInitiator, uint256 indexed proposalId);
    event ValidatorAdded(address indexed validator);

    // ============ Modifiers ============
    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    modifier onlyValidator() {
        require(validators[msg.sender], "Only validators can call this function");
        _;
    }

    // ============ Constructor ============
    constructor(
        string memory _description,
        uint256 _deadline,
        uint256 _minApprovals
    ) payable {
        owner = msg.sender;
        currentTask = Task({
            description: _description,
            reward: msg.value,
            deadline: block.timestamp + _deadline,
            createdAt: block.timestamp,
            isCompleted: false,
            minApprovals: _minApprovals
        });
        
        validators[msg.sender] = true;
        validatorCount = 1;
    }

    // ============ Public Functions ============
    function submitProposal(string memory _proofOfWork) public {
        require(block.timestamp < currentTask.deadline, "Task deadline passed");
        require(!currentTask.isCompleted, "Task already completed");
        
        proposals.push(Proposal({
            hunter: msg.sender,
            proofOfWork: _proofOfWork,
            timestamp: block.timestamp,
            approvalCount: 0,
            isApproved: false
        }));
        
        emit ProposalSubmitted(msg.sender, proposals.length - 1);
    }

    function approveProposal(uint256 _proposalId) public onlyValidator {
        require(_proposalId < proposals.length, "Invalid proposal");
        require(!proposalApprovers[_proposalId][msg.sender], "Already approved");
        
        proposalApprovers[_proposalId][msg.sender] = true;
        proposals[_proposalId].approvalCount++;
        
        if (proposals[_proposalId].approvalCount >= currentTask.minApprovals && !currentTask.isCompleted) {
            currentTask.isCompleted = true;
            proposals[_proposalId].isApproved = true;
            payable(proposals[_proposalId].hunter).transfer(currentTask.reward);
            emit ProposalApproved(_proposalId);
        }
    }

    function addValidator(address _validator) public onlyOwner {
        require(!validators[_validator], "Already a validator");
        validators[_validator] = true;
        validatorCount++;
        emit ValidatorAdded(_validator);
    }

    function raiseDispute(uint256 _proposalId) public onlyValidator {
        require(_proposalId < proposals.length, "Invalid proposal");
        require(!proposals[_proposalId].isApproved, "Proposal already approved");
        
        emit DisputeRaised(msg.sender, _proposalId);
    }

    // ============ View Functions ============
    function getProposalCount() public view returns (uint256) {
        return proposals.length;
    }

    function getTimeLeft() public view returns (uint256) {
        if (block.timestamp >= currentTask.deadline) return 0;
        return currentTask.deadline - block.timestamp;
    }
}

contracts/Test.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract Test {
    string private message;

    constructor(string memory initialMessage) {
        message = initialMessage;
    }

    function setMessage(string memory newMessage) public {
        message = newMessage;
    }

    function getMessage() public view returns (string memory) {
        return message;
    }
}

